(11, 338, 'Rabu', '2025-11-19', '3', 'Desain Grafis Kemasan', '1.Memahami pengertian dan fungsi desain grafis \r\nkemasan.\r\n 2. Mengidentifikasi prinsip-prinsip desain kemasan.\r\n 3. Menjelaskan langkah pembuatan desain kemasan.\r\n 4. Menganalisis contoh desain kemasan.\r\n  5. Membuat rancangan desain kemasan sederhana.\r\n', '2025-11-19 10:48:07', '52'),
